import React,{useState} from 'react'
import { 
    CarouselContainer,
    CarouseItems,
    Item
}from './CarouselElements'
const Carousel = ({data}) => {

    return (
        <>
           <CarouselContainer>
                <CarouseItems>
                    {
                        data.map((item)=>{
                            return(<>
                                <Item>
                                <h1>item.title</h1>
                                <p>item.descrip</p>
                                </Item>
                            </>)
                        })
                    }
                </CarouseItems>
            </CarouselContainer>
        </>
    )
}

export default Carousel
